import React from "react"

const Image = ({src, width, alt}) => {
    const getSrc = () => {
        return require(src)  //require(`assets/images/${src}`)
    }

    return (
        <img alt={alt} src={getSrc()} style={{ width: `${width}`}} />
    )
}

export default Image
